import styled from "styled-components";

const StyledRoom = styled.div`
  display: flex;
  flex-direction: column;
  width: 480px;
  border-style: solid;
  border-color: #bfbfbf;
  border-radius: 5px;
  margin-bottom: 10px;
`;

export default StyledRoom;
